import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';
import logo from "./logo.svg";
import {Form, InputGroup, FormControl, Button} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

function isolations(){
    return [
        {
            id: 1,
            title: "ultracentrifugation",
            completed: false,
        },
        {
            id: 2,
            title: "density gradient",
            completed: false,
        },
        {
            id: 3,
            title: "size exclusion chromatography",
            completed: false,
        }
    ]
}

function App() {
    const methods = isolations();
    return (
        <>
            <Form>
                <ul>
                    {methods.map((method) => (
                        <InputGroup key={method.id}>
                            <InputGroup.Checkbox checked={method.completed} />
                            <FormControl
                                value = {method.title}
                                style={{textDecoration: method.completed ? "line-through 4px" : "none",
                                }}
                            />
                        </InputGroup>

                    ))}
                </ul>
                <Button variant="success">Submit</Button>
            </Form>


        </>

